import React, { Component } from 'react';
import Items from './items.js'

class List extends Component {

  test = this.props.todos;

    render() {
      return (
        <div className="List">
        {console.log(this.props.todos, "list")}
        <Items todos={test}></Items>
        </div>
      );
    }
  }

  export default List;
